@WillyFlowerz: There's no benefit or detriment to converting from 2D to 3D here, if you keep the total bits the same. The 2D or 3D representation is just a visual aid, and not deterministic.

Instead of using 16 spaces, let's use 64 spaces, like in the chess example. If we represent these 64 spaces in 2D, we'd get 8 rows and 8 columns. We'd need 3 bits to indicate the row, 3 bits to indicate the column, and the 0th bit for control (since it doesn't fall in any of the rows or columns that are being checked), for a total of 7 bits.

Now if we represent 64 spaces in 3D, we'd get 4 rows, 4 columns and 4 z-levels. We'd need 2 bits to indicate the row, 2 bits to indicate the column, 2 bits to indicate the Z-level, and the 0th bit for control (since it doesn't fall in any or the rows, columns or z-levels that are being checked), for a total of 7 bits.

this is the code in js if you want to test it, and it's very short actually

it will find and correct if there is 1 error, and say if there are 2 errors.

function Hamming(message) {
  const error = parseInt(message.split("").map((a, b, c) => a == "0" ? Array((c.length - 1).toString(2).length).fill("0").join("") : (Array((c.length - 1).toString(2).length).fill("0").join("") + b.toString(2)).slice(-Math.floor(Math.log2(c.length)))).reduce((a, b) => a.split("").map((c, d) => (Number(b[d]) + Number(c)) % 2).join("")), 2)
  const parity = message.split("").reduce((a, b) => (Number(a) + Number(b)) % 2)

  if (parity == 1) return message.split("").map((a, b) => b == error ? 1 - a : a).join("")
  if (error == 0) return message
  return "2 errors"
}

